import React from 'react'

const Modalimage = ({
    isopen,
    handleopenmodal,
    handleclosemodal,
    imagemodal,
  }) => {
    Modal.setAppElement("#root");
    const customStyles = {
      content: {
        top: "50%",
        left: "50%",
        right: "auto",
        bottom: "auto",
        marginRight: "-50%",
        transform: "translate(-50%, -50%)",
      },
    };
    //   console.log(isopen)
    return (
      <div>
        <Modal
          isOpen={isopen}
          onRequestClose={handleclosemodal}
          style={customStyles}
          contentLabel="Example Modal"
        >
          <div className="box-modal">
            <img
              className="imgmodal"
              alt="previewImg"
              src={imagemodal}
              style={{ overflow: "hidden" }}
            />
          </div>
          
        </Modal>
      </div>
    );
  };
export default Modaldelete
